import React from 'react';

import {
    ArtBrowser, ArtBrowserWindowBar,
    ArtBrowserCloseButton, ArtBrowserMinimizeButton,
    ArtBrowserMaximizeButton, ArtBrowserContent
} from './styles';

function Browser() {

    return (
        <ArtBrowser>
            <ArtBrowserWindowBar>
                <ArtBrowserCloseButton />
                <ArtBrowserMinimizeButton />
                <ArtBrowserMaximizeButton />
            </ArtBrowserWindowBar>
            <ArtBrowserContent>
                <p>{'<!DOCTYPE html>'}</p>
                <p>{'<html>'}</p>
                <p>{'<head>'}</p>
                <p>{'<title>Seja bem vindo</title>'}</p>
                <p>{'</head>'}</p>
                <p>{'</html>'}</p>

                <p>Sou de Minas Gerais e tenho 19 anos, </p>
            </ArtBrowserContent>
        </ArtBrowser>
    );
}

export default Browser;
